                    var bvi_voice_class = $(this).parent().parent().data('bvi-voice-class');
                    var bvi_voice_text = $(bvi_voice_class).text();
                    if(bvi_voice_class) {
                        if(Cookies.get('bvi-voice') === 'true'){
                            responsiveVoice.speak(bvi_voice_text);
                        }
                    } else {
                        responsiveVoice.cancel();
                    }
                    return false;
